        public void TestCreateService()
        {
            var service = SplunkContainer.CreateSplunkService("https://localhost:8089/", "UnitTestIndex", "admin", "log4netpass").GetAwaiter().GetResult();
            Assert.IsNotNull(service.Context);
            Assert.IsNotNull(service.Context.SessionKey);
        }

